import React from 'react';
import HelloWorld from './Components/HelloWorld';
import Header from './Components/Header';
import Footer from './Components/Footer';
import Sidebar from './Components/Sidebar';

function App() {
  return (
    <div>
      <Header />    
      <HelloWorld />
      <Sidebar />
      <Footer />
    </div>
  );
}

export default App;
